import React from "react";
// import data
import Data from "../data";
// import use params
import { useParams } from "react-router-dom";
//import Link
import {Link} from 'react-router-dom';
//import icons
import { BiDownload, BiStar } from "react-icons/bi";
// get the  house id
//console.log(id);
//get the house based on id
//console.log(house);

//import style
const sizeStyle = {
  height: "auto",
  width: "20rem",
};

const ItemsDetails = () => {
  const { id } = useParams();
  const item = Data.find((item) => {
    // get the  house id
    return item.id === parseInt(id);
  });
  //console.log(item);
  return (
    <section>
      <div className="container mx-auto min-h-[800px] mb-14">
        <div className="flex flex-col lg:flex-row lg:items-center lg:justify-between">
          <div className="">
            <h2 className="text-2xl font-semibold">{house.name}</h2>
            <h3 className="text-lg mb-4">{house.address}</h3>
          </div>
          <div className="mb-4 lg:mb-0 flex gap-x-2 text-sm">
            <div className="bg-green-500 text-white px-3 rounded-full">
              {house.type}
            </div>
            <div className="bg-violet-500 text-white px-3 rounded-full">
              {house.country}
            </div>
          </div>
          <div className="text-3xl font-semibold text-violet-600">
            $ {house.price}
          </div>
        </div>
        <div className="flex flex-col items-start gap-8 lg:flex-row">
          <div className="max-w-[768px]">
            <div className="mb-8">
              <img src={house.imageLg} alt="" />
            </div>
            <div className="flex gap-x-6 text-violet-700 mb-6">
              <div className="flex gap-x-2 items-center">
                <BiBed className="text-2xl"/>
                  <div>{house.bedrooms}</div>
              </div>
              <div className="flex gap-x-2 items-center">
                <BiBath className="text-2xl"/>
                  <div>{house.bathrooms}</div>

              </div>
              <div className="flex gap-x-2 items-center">
                <BiArea className="text-2xl"/>
                  <div>{house.surface}</div>
              </div>
            </div>
              <div className="">{house.description}</div>
          </div>
          <div className="flex-1 bg-white w-full mb-8 border border-gray-300 rounded-lg px-6 py-8">
            <div className="flex items-center gap-x-4 mb-8">
              <div className="w-20 h-20 p-1 border border-gray-300 rounded-full">
                <img src={house.agent.image} alt="" />
              </div>
              <div className="">
                <div className="font-bold text-lg">{house.agent.name}</div>
                <Link to='' className='text-violet-700 text-sm'>View Listings</Link>
              </div>
            </div>
            {/* form */}
            <form className="flex flex-col gap-y-4" action="">
              <input className="border border-gray-300 focus:border-violet-700 outline-none rounded w-full px-4 h-14 text-sm" placeholder="Name*" type="text" />
              <input className="border border-gray-300 focus:border-violet-700 outline-none rounded w-full px-4 h-14 text-sm" placeholder="Email*" type="text" />
              <input className="border border-gray-300 focus:border-violet-700 outline-none rounded w-full px-4 h-14 text-sm" placeholder="Phone*" type="text" />

              <textarea className="border border-gray-300 focus:border-violet-700 outline-none resize-none rounded w-full p-4 h-36 text-sm text-gray-400" placeholder="Message*" defaultValue='Hello I am interested in this [Modern House]'></textarea>
              <div className="flex gap-x-2">
                <button className="bg-violet-700 hover:bg-violet-800 text-white rounded p-4 text-sm w-full transition"><BiDownload /></button>
                <button className="border border-violet-700 hover:border-violet-500 text-violet-700  hover:text-violet-500 rounded p-4 text-sm w-full transition"><BiStar /></button>
              </div>
            </form>
          </div>
        </div>
      </div>
    </section>
  );
};

export default ItemsDetails;
